import React, { useState } from 'react';

const TodoItem = ({ todo, onUpdateTodo, onDeleteTodo }) => {
  const [isEditing, setIsEditing] = useState(false);
  const [editTitle, setEditTitle] = useState(todo.title);
  const [editDescription, setEditDescription] = useState(todo.description);
  const [isUpdating, setIsUpdating] = useState(false);

  const handleToggleComplete = async () => {
    setIsUpdating(true);
    try {
      await onUpdateTodo(todo.id, {
        ...todo,
        completed: !todo.completed
      });
    } catch (error) {
      console.error('Error toggling todo:', error);
    } finally {
      setIsUpdating(false);
    }
  };

  const handleSaveEdit = async () => {
    if (!editTitle.trim()) return;

    setIsUpdating(true);
    try {
      await onUpdateTodo(todo.id, {
        ...todo,
        title: editTitle.trim(),
        description: editDescription.trim()
      });
      setIsEditing(false);
    } catch (error) {
      console.error('Error updating todo:', error);
    } finally {
      setIsUpdating(false);
    }
  };

  const handleCancelEdit = () => {
    setEditTitle(todo.title);
    setEditDescription(todo.description);
    setIsEditing(false);
  };

  const handleDelete = async () => {
    if (window.confirm('Apakah Anda yakin ingin menghapus todo ini?')) {
      try {
        await onDeleteTodo(todo.id);
      } catch (error) {
        console.error('Error deleting todo:', error);
      }
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('id-ID', {
      year: 'numeric',
      month: 'short',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <div className={`todo-item ${todo.completed ? 'completed' : ''}`}>
      <div className="todo-content">
        <div className="todo-checkbox">
          <input
            type="checkbox"
            checked={todo.completed}
            onChange={handleToggleComplete}
            disabled={isUpdating || isEditing}
          />
        </div>

        {isEditing ? (
          <div className="todo-edit-form">
            <input
              type="text"
              value={editTitle}
              onChange={(e) => setEditTitle(e.target.value)}
              className="edit-input"
              disabled={isUpdating}
            />
            <textarea
              value={editDescription}
              onChange={(e) => setEditDescription(e.target.value)}
              className="edit-textarea"
              rows="2"
              disabled={isUpdating}
            />
            <div className="edit-buttons">
              <button 
                onClick={handleSaveEdit}
                className="btn btn-save"
                disabled={!editTitle.trim() || isUpdating}
              >
                {isUpdating ? 'Menyimpan...' : 'Simpan'}
              </button>
              <button 
                onClick={handleCancelEdit}
                className="btn btn-cancel"
                disabled={isUpdating}
              >
                Batal
              </button>
            </div>
          </div>
        ) : (
          <div className="todo-details">
            <h3 className="todo-title">{todo.title}</h3>
            {todo.description && (
              <p className="todo-description">{todo.description}</p>
            )}
            <div className="todo-meta">
              <span className="todo-date">
                Dibuat: {formatDate(todo.created_at)}
              </span>
              {todo.updated_at !== todo.created_at && (
                <span className="todo-date">
                  Diperbarui: {formatDate(todo.updated_at)}
                </span>
              )}
            </div>
          </div>
        )}
      </div>

      {!isEditing && (
        <div className="todo-actions">
          <button 
            onClick={() => setIsEditing(true)}
            className="btn btn-edit"
            disabled={isUpdating}
          >
            Edit
          </button>
          <button 
            onClick={handleDelete}
            className="btn btn-delete"
            disabled={isUpdating}
          >
            Hapus
          </button>
        </div>
      )}
    </div>
  );
};

export default TodoItem;
